account.custom_css:
:root {
 --gray1: #e3d5ca;
 --gray2: #F6F4F3;
 --gray4: #fff;
 --gray5: #F6F4F3;
--fg-accent: #496495;
 --toot-bg: none;
}


pre code {
overflow-wrap: normal;
  word-break: normal;
  border-radius: .375rem;
  background-color: #F6F4F3;
  line-height: 1.5;
font-family: SF Mono,SFMono-Regular,ui-monospace,Menlo,Monaco,Consolas,Liberation Mono,Courier New,monospace;
font-size: 0.85em;}

p code {font-family: SF Mono,SFMono-Regular,ui-monospace,Menlo,Monaco,Consolas,Liberation Mono,Courier New,monospace;
font-size: 0.85em;}


html, body {
  background: #FAFAFA;
  color: #474645;
  }

.profile .header {
  background: #F6F4F2;
  border: 1px solid #d6ccc2;
}

header a h1 { color: #343433 !important; }

.toot { box-shadow: none; margin-bottom:1em, background: #F6F4F3; }
.status { background-color: #F6F4F3}
.status .status-info { background-color: #ffffff; }
